import React from 'react'
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import LanguageIcon from '@mui/icons-material/Language';

function Footer() {
  return (
    <div className='footer'>
        <div className='info'>
        <div className='Icons'> <LanguageIcon/></div>
        <div style={{marginTop:2}}><h2> <b>www.eyerov.com</b></h2></div>
        <div className='Icons'> <MailOutlineIcon/></div>
        <div style={{marginTop:2}}><h2> <b>info@eyerov.com</b></h2></div>
        </div>
    </div>
  )
}

export default Footer
